		/// <summary>
		/// 根据指定条件获取 GpoAttr 列表
		/// </summary>
		/// <param name="GpoId"></param>
		/// <param name="MatchMode"></param>
		public static List<GpoAttr> GetGpoAttrsByGpoIdMatchMode( int gpoId, int matchMode )
		{
			List<GpoAttr> result = new List<GpoAttr>();
			foreach (GpoAttr data in Data)
			{
				if ( data.GpoId == gpoId && data.MatchMode == matchMode)
				{
					result.Add(data);
				}
			}
			return result;
		}
